                                    "type": "wms",
                                    "name": "Annual Agricultural Stress Index (ASI) ",
                                    "description": "<div><a href='/th/dataset/global-drought-monitoring-agricultural-stress-index-asi'>Download Dataset</a></div><div>The Index is based on the integration of the Vegetation Health Index (VHI) in two dimensions that are critical in the assessment of a drought event in agriculture: temporal and spatial. The first step of the ASI calculation is a temporal averaging of the VHI, assessing the intensity and duration of dry periods occurring during the crop cycle at the pixel level; this calculation includes the use of crop coefficients, which introduces sensitivity of a crop to water stress during each phenological phase. The second step determines the spatial extent of drought events by calculating the percentage of pixels in arable areas with a VHI value below 35 percent (this value was identified as a critical threshold in assessing the extent of drought in previous research by Kogan, 1995). Each administrative area is classified according to the percentage of the affected area to facilitate the quick interpretation of results.\r\n\r\nImportant note: Map legend value= Pixel physical value * multiplier (0.5)</div>",
