                                    "name": "Mekong ecoregions",
                                    "description": "<div><a href='/th/dataset/freshwater-ecoregions-of-the-mekong-basin'>Download Dataset</a></div><div>This dataset was created from Hydrosheds level 3 dataset to represent approximate freshwater ecoregions of the Mekong basin. Based upon the WWF freshwater ecoregions dataset which is defined as, a large area encompassing one or more freshwater systems that contains a distinct assemblage of natural freshwater communities and species. The freshwater species, dynamics, and environmental conditions within a given ecoregion are more similar to each other than to those of surrounding ecoregions and together form a conservation unit. </div>",
