                                    "name": "Global Lakes and Wetlands Database: Lakes and Wetlands Grid (Level 3)",
                                    "description": "<div><a href='/th/dataset/global-lakes-and-wetlands-database'>Download Dataset</a></div><div>The combination of best available sources for lakes and wetlands on a global scale (1:1 to 1:3 million resolution), and the application of GIS functionality enabled the generation of a database which focuses in three coordinated levels on (1) large lakes and reservoirs, (2) smaller water bodies, and (3) wetlands.\r\n\r\nLevel 1 (GLWD-1) comprises the 3067 largest lakes (area ≥ 50 km2) and 654 largest reservoirs (storage capacity ≥ 0.5 km3) worldwide, and includes extensive attribute data.\r\n\r\nLevel 2 (GLWD-2) comprises permanent open water bodies with a surface area ≥ 0.1 km2 excluding the water bodies contained in GLWD-1.\r\n\r\nFor GLWD-3, the polygons of GLWD-1 and GLWD-2 were combined with additional information on the maximum extents and types of wetlands. Class ‘lake’ in both GLWD-2 and GLWD-3 also includes man-made reservoirs, as only the largest reservoirs have been distinguished from natural lakes.</div>",
