                                    "type": "wms",
                                    "name": "Marine Ecoregions",
                                    "description": "<div><a href='/th/dataset/marine-ecoregions'>Download Dataset</a></div><div>A biogeographic classification of the world's coastal and continental shelf waters following a nested hierarchy of realms, provinces and ecoregions. USERS PLEASE NOTE - shapefile does NOT accurately represent outer MEOW boundaries: As specified in the original publications, the boundaries in this shapefile have been extended out some 200 nautical miles from land (and this buffer is extended to include any additional marine areas less than 200metres in depth which lie beyond this distance). This outer boundary buffer is primarily drawn here to ease visibility of ecoregions in global and regional scale maps. Similarly the inland boundaries of the ecoregions extend far inland - a convention to ensure inclusion of any coastline and estuarine/lagoonal systems which may be derived from different map sources. As specified, the ecoregional classification relates primarily to coast and shelf biotas for which a 200m depth contour is a more accurate indicative boundary. It is therefore not an appropriate use of the data to calculate total ecoregion areas or generate other area or volumetric dependent statistics using these boundaries alone. A version of the shapefile cut to shelf areas will be released on this site by December 2007. TNC users please note: TNC has adopted the Marine Ecoregions of the World as our marine ecoregional boundaries, but in some cases around North America we are using older and slightly different boundaries for ecoregional planning. These other boundaries can be found in the marine ecoregional assessment layer directly below on this page. Download this data at: http://maps.tnc.org/</div>",
