                                    "description": "<div><a href='/th/dataset/tiger-conservation-landscape'>Download Dataset</a></div><div>These three data sets produced by WWF and RESOLVE showing the location of the current tiger habitat and priority areas for habitat conservation. Tiger Conservation Landscapes (TCLs) are large blocks of the contiguous or connected areas of suitable tiger habitat that can support at least five adult tigers and where tiger presence has been confirmed in the past 10 years. The data set was created by mapping tiger distribution, determined by land cover type, forest extent, and prey base, against a human influence index. Areas of high human influence that overlapped with suitable habitat were not considered tiger habitat.</div>",
