                                    "type": "wms",
                                    "name": "Mean of Carbon Monoxide (March 2021)",
                                    "description": "<div><a href='/th/dataset/air-quality-carbon-monoxide'>Download Dataset</a></div><div>คาร์บอนมอนอกไซด์ (Carbon monoxide - CO) เป็นก๊าซติดตามชั้นบรรยากาศที่สำคัญต่อการทำความเข้าใจปฏิกิริยาเคมีในชั้นโทรโพสเฟียร์ ในเขตเมืองบางแห่งคาร์บอนมอนอกไซด์เป็นตัวก่อมลพิษในชั้นบรรยากาศที่สำคัญ CO เกิดจากการเผาไหม้ที่ไม่สมบูรณ์ของเชื้อเพลิงที่มีคาร์บอนเป็นส่วนประกอบ เช่น เชื้อเพลิงซากดึกดำบรรพ์หรือฟอสซิล การเผาไหม้พลังงานชีวมวล และปฏิกิริยาออกซิเดชั่นในชั้นบรรยากาศของก๊าซมีเธนและไฮโดรคาร์บอนอื่น ๆ ในขณะที่การเผาไหม้เชื้อเพลิงฟอสซิลเป็นสาเหตุหลักของการเกิด CO ในกลุ่มประเทศที่ตั้งบริเวณเขตละติจูดกลางตอนบน การออกซิเดชั่นของไอโซพรีนและการเผาไหม้พลังงานชีวมวลจะเกิดขึ้นมากในกลุ่มประเทศบริเวณเขตร้อน TROPOMI บนดาวเทียม Sentinel 5 Precursor (S5P) เฝ้าสังเกตอัตราของ CO ทั่วโลกที่ใช้ประโยชน์จากการวัดความสว่างของโลกในท้องฟ้าปลอดโปร่งและท้องฟ้าที่มีเมฆมากในช่วงสเปกตรัม 2.3 ของส่วนคลื่นอินฟราเรดคลื่นสั้น (SWIR) ของสเปกตรัมแสงอาทิตย์ การสังเกตการณ์ท้องฟ้าแจ่มใสของ TROPOMI แสดงค่ารวมคอมลัมน์ของ CO มีความไวต่อชั้นขอบเขตโทรโพสเฟียร์ สำหรับบรรยากาศที่มีเมฆมาก ความไวของคอลัมน์จะเปลี่ยนไปตามเส้นแสง</div>",
