                                    "description": "<div><a href='/th/dataset/provincial-investment-plan-in-piped-water-supply'>Download Dataset</a></div><div>The dataset of Provincial Investment Plan in Piped Water Supply (PIP) Study was conducted by Investing in Infrastructure (3i) program in 2020 funded by Australian Aid. The study provided data on the coverage and licensing status of all villages in 25provinces. The coverage and licensing data in 22 provinces were collected by the study itself. The study received coverage and licensing status data in Phnom Penh from the General Department of Potable Water, Ministry of Industry, Science, Technology & Innovation, and the coverage and licensing status data in Siem Reap and Prey Veng from the World Bank. \r\nThe study assessed if villages not yet covered by existing piped water supply in 22 provinces were suitable for piped water infrastructure or not. For villages not yet covered by existing piped water supply and suitable for piped water infrastructure in 22 provinces, the study designed optimal villages cluster for piped water systems and estimates the​​ indicative investment cost of those designed systems.</div>",
