                            "name": "Myanmar Oil and Gas Blocks 2017-2018",
                            "description": "<div><a href='/th/dataset/myanmar-oil-and-gas-blocks-2017-2018'>Download Dataset</a></div><div>Allocated oil and gas block licence data as geodata based on MEITI 5th Report (FY2017/18) published annex data and block coordinate list released by MEITI in 2019 (http://www.myanmareiti.org/files/uploads/license_information2017-2018.xlsx).\r\nThe dataset contains all oil and gas blocks that were allocated during fiscal year 2017/2018 and attributes such as type of block, type of activity, operating companies, etc.\r\n\r\nAs the MEITI licence annex data contains some inaccuracies and errors, OneMap Myanmar used coordinate information contained in a separate document shared by MEITI in 2018 (https://myanmareiti.org/files/uploads/4._updated_combined_onshore_offshore_psc_blocks_conditions_all.pdf) as well as a best-guess approach to correct those.\r\n\r\nThis dataset includes the original and cleaned data columns.\r\nAdditional processing attributes were added during the data generation  by OneMap Myanmar. The detailed description of attribute fields can be found in attached metadata attributes excel sheet.\r\n\r\nThe original metadata was in English language and it was translated to Burmese language by ODM team. Both metadata are attached in the zipped shapefile in excel format. </div>",
