                            "description": "<div><a href='/th/dataset/assessment-of-undiscovered-copper-resources-in-cambodia'>Download Dataset</a></div><div> Deposits, prospects, and permissive tracts for porphyry and sediment-hosted copper resources Cambodia, with estimates of undiscovered copper resources. Copper resources are reported for related deposits in close proximity to each other; the tracts outline principal areas of the world that have potential for undiscovered porphyry copper resources; the tracts were used to estimate the probable amounts of those resources at depths within 1 km below the earth's surface. Attributes include tract identifiers, tract name, location coordinates, country and state or province, grade/tonnage model used to assess tract, a brief description of the basis for tract delineation, age, assessment results, and multiple economic results.Location coordinates can represent a generalized location or a specific mineralized site; for all of the deposits in the group, grade represents the weighted average while tonnage represents the total ore tonnage. </div>",
